field_descriptions_list:
  path: '/admin/reports/fields/field-descriptions-list'
  defaults:
    _form: '\Drupal\field_descriptions_list\Form\FieldDescriptionsListEntitiesForm'
    _title: 'Field descriptions list'
  requirements:
    _permission: 'administer content types'
field_descriptions_list_import:
  path: '/admin/reports/fields/field-descriptions-list-import'
  defaults:
    _form: '\Drupal\field_descriptions_list\Form\FieldDescriptionsListImportForm'
    _title: 'Field descriptions list import'
  requirements:
    _permission: 'administer content types'
